(14, 'Herb Cheese Pouch Leak Test', 'general qa check', '', 0, '0', 0, '30 Mins', 22, 2, 3, '2019-07-25', '2019-06-11 14:35:00', NULL, '00:00:00', '2019-12-14 14:35:00', '00:00:00', 1, 1, 118, 126, 0),
(15, 'Herb Cheese Pouch Record', 'general qa check', 'All packaging materials used for production are required to follow the FIFO (First In First Out) procedure at all times', 0, '0', 0, 'hourly', 22, 2, 3, '2019-07-25', '2019-06-11 14:40:00', NULL, '00:00:00', '2019-11-07 14:40:00', '00:00:00', 1, 1, 118, 119, 0),
(16, 'Herb Cheese Pouch Formulation Checklist', 'general qa check', '', 0, '0', 0, 'Daily', 22, 2, 3, '2019-07-25', '2019-06-11 14:54:00', NULL, '00:00:00', '2019-11-02 14:54:00', '00:00:00', 1, 1, 118, 119, 0),
(17, 'Filling Bowl FDA CCP Monitoring Record', 'general qa check', '1.  Monitoring: Filling bowl temperature is monitored at the 1st filling bowl, and hourly +/- 15 minutes during production at bottom depth of bowl.    2.  Direct Observation monitoring is twice per week by QC, weekly by QA. 3.  Record and Pre-shipment Review is done daily. 4. Critical Limit MUST be at or below 44.6oF 5. HOLD if deviation. 6.  HACCP Deviation Form must be completed if any deviations occur. ', 0, '0', 0, 'hourly', 13, 2, 3, '2019-07-18', '2019-06-11 14:56:00', NULL, '00:00:00', '2019-12-14 14:56:00', '00:00:00', 1, 1, 41, 97, 0),
(18, 'Filling Bowl USDA CCP Monitoring Record', 'general qa check', '1.  Monitoring: Filling bowl temperature is monitored at the 1st filling bowl, and hourly +/- 15 minutes during production at bottom depth of bowl.    2.  Direct Observation monitoring is twice per week by QC, weekly by QA. 3.  Record and Pre-shipment Review is done daily. 4. Critical Limit MUST be at or below 44.6oF 5. HOLD if deviation. 6.  HACCP Deviation Form must be completed if any deviations occur. ', 0, '0', 0, 'hourly', 13, 2, 3, '2019-07-15', '2019-06-11 15:00:00', NULL, '00:00:00', '2019-12-07 15:00:00', '00:00:00', 1, 1, 41, 97, 0),
(19, 'Filling Bowl Seafood CCP Monitoring Record', 'general qa check', '1.  Monitoring: Filling bowl temperature is monitored at the 1st filling bowl, and hourly +/- 15 minutes during production at bottom depth of bowl.    2.  Direct Observation monitoring is twice per week by QC, weekly by QA. 3.  Record and Pre-shipment Review is done daily. 4. Critical Limit MUST be at or below 44.6oF 5. HOLD if deviation. 6.  HACCP Deviation Form must be completed if any deviations occur. ', 0, '0', 0, 'hourly', 13, 2, 3, '2019-07-08', '2019-06-11 15:00:00', NULL, '00:00:00', '2019-12-07 15:00:00', '00:00:00', 1, 1, 41, 97, 0),
(20, 'PPC-5 Metal Detection Inspection Log', 'general qa check', 'Corrective Actions: 1. If alarm/reject fails on standards check with test wands, all product will be placed on hold by QC/QA back to the last good documented check.  Product evaluation and disposition in accordance with hold program. 2. Rejects are re-screened through unit 3 additional times.  If none of the 3 re-screens are rejected, the reject is deemed a false alarm and package is released.  Circle \'Y\' on form. If any of re-screens reject, circle \'N\' on form.  The package is condemned and QC/', 0, '0', 0, 'hourly', 15, 2, 3, '2019-07-08', '2019-06-11 15:04:00', NULL, '00:00:00', '2019-12-07 15:04:00', '00:00:00', 1, 1, 109, 111, 0),
(21, 'CCP4- Seafood Metal Inclusion Monitoring', 'general qa check', '1. Metal Detecter is monitored once an hour during  production. \n2. Direct Observation monitoring is once a shift.\n3. Record and Pre-shipment review is done daily.\n', 0, '0', 0, 'hourly', 15, 2, 3, '2019-07-08', '2019-06-11 15:08:00', NULL, '00:00:00', '2019-12-13 15:08:00', '00:00:00', 1, 1, 109, 111, 0),
