(68, 'Machine Filling & Dough Audit', 'general qa check', '1.       Check at least 7 pieces for each machine running at start up and every 2 hours (QC daily). \n2.       Weigh ravioli, record weight in whole column.\n3.       Open ravioli and scrape away all filling.\n4.       Weigh scraped dough and record weight in dough column.\n5.       Whole weight – dough weight = filling weight.\n6.       Divide whole weight / filling weight x 100 = filling %.\n7.       Corrective action: If filling % is out of spec, stop the machine notify machine operator to adjust. ', 0, '0', 0, 'hourly', 9, 2, 3, '2019-07-08', '2019-07-02 11:49:00', NULL, '00:00:00', '2020-01-09 11:49:00', '00:00:00', 1, 1, 98, 99, 0),
