(70, '(REFRIGERATED) Multivac Operator Records - Yuba City', 'general qa check', 'Check 1 tray for each forming unit drop at start-up and every half hour.\n1. Put tray AX & AY into leaking test tank and close the lid.\n2. Turn the air switch on and wait for the gauge to 15 Hg.\n3. Observe any leaking bubbles\n4. Turn the air switch off and open the lid\n5. Use a towel with sanitizer to dry out the tray and then repack', 0, '0', 0, '30 Mins', 14, 2, 3, '2019-07-08', '2019-07-02 12:05:00', NULL, '00:00:00', '2020-01-10 12:05:00', '00:00:00', 1, 1, 105, 106, 0),
