(78, 'PPC-4 Label verification log', 'general qa check', 'Note: 1) Packages must be checked at minimally the following frequency per product item: a) first package off the line, b) package from the middle of the product run, c) last package off the line per product, d) every new roll. 2) Packages must be checked to make sure the correct product (contents) is in the proper package with the correct label. 3) Allergen content is verified to ensure proper declaration.  The label and allergens are compared against a standard.  NOTE: During label change over', 0, '0', 0, 'Shift', 14, 2, 3, '2019-07-08', '2019-07-02 12:39:00', NULL, '00:00:00', '2019-11-02 12:39:00', '00:00:00', 1, 1, 105, 108, 0),
