(81, ' operational sanitation performance standard', 'general qa check', 'Place ACC next to each item if it is in Acceptable condition.  If an item is unacceptable, write UNACC then turn page over and address the deficiency and corrective action on the back of this form.  If a deficiency is observed between scheduled monitoring checks, the time of the deficiency will be noted and only the item that is deficient will be noted with UNACC.  A description of the deficiency along with the Corrective Action will be documented on the back of this page.  All areas will be mon', 0, '0', 0, 'Shift', 1, 2, 3, '2019-07-08', '2019-07-02 13:01:00', NULL, '00:00:00', '2019-12-05 13:01:00', '00:00:00', 1, 1, 124, 125, 0),
