(84, 'PPC-1 Pre-Op Inspection Checklist', 'general qa check', 'Parameters/Limits: 1. Ensure no visible food debris or contaminants on food contact surfaces. 2. Sanitizer must be applied to all post lethality exposed food contact surfaces for minimum contact time. 3. Concentration must be at appropriate ppm concentration with sanitizer approved for no rinse and if needed for organic. Monitoring- What: 1. Inspect cleanliness of post lethality food contact surfaces on line. 2. Apply sanitizer to post lethality exposed food contact surfaces for minimum contact ', 0, '0', 0, 'Shift', 1, 2, 3, '2019-07-08', '2019-07-02 13:18:00', NULL, '00:00:00', '2019-11-02 13:18:00', '00:00:00', 1, 1, 90, 92, 0),
(85, 'APC, Coliform, Yeast & Mold (Line 1,2,3) Swab Form', 'general qa check', '1.	After sanitizing equipment, wait at least 15 minutes and let dry before swabbing or operating.      \n2.	Prepare the swab by holding it with the bulb end near your thumb. Bend the red snap valve at a 45° angle until you hear the valve break to allow the letheen broth to flow into the tube end. \n3.	Twist and pull apart the bulb end of the swab from the tube end of the swab which contains the letheen broth.\n4.	Rub the swab slowly and thoroughly over the desired surface area. Rub the swab three t', 0, '0', 0, 'Weekly', 1, 2, 3, '2019-07-08', '2019-07-03 13:25:00', NULL, '00:00:00', '2019-10-10 13:25:00', '00:00:00', 1, 1, 90, 91, 0),
