(88, ' ATP Swab -YC Production', 'general qa check', '1.	After sanitizing equipment, wait at least 15 minutes and let dry before swabbing or operating.\n2.	Unscrew Pocket Swab Plus and swab on various surfaces in a 4x4 square to find the ATP count. \n3.	Screw back into housing, break the seal, and shake the mixture so that it is evenly distributed. \n4.	 Put Swab into the NovaLum, and press the test button to determine the ATP count. \n5.	All locations from ATP, APC, Coliform, Yeast & Mold list must be checked for ATP count. \n6.	After sanitizing equipm', 0, '0', 0, 'Shift', 1, 2, 3, '2019-07-15', '2019-07-02 13:33:00', NULL, '00:00:00', '2019-09-04 13:33:00', '00:00:00', 1, 1, 90, 91, 0),
(89, 'Filling Bowl Seafood CCP Monitoring Record', 'general qa check', '1.  Monitoring: Filling bowl temperature is monitored at the 1st filling bowl, and hourly +/- 15 minutes during production at bottom depth of bowl.    2.  Direct Observation monitoring is twice per week by QC, weekly by QA. 3.  Record and Pre-shipment Review is done daily. 4. Critical Limit MUST be at or below 44.6oF 5. HOLD if deviation. 6.  HACCP Deviation Form must be completed if any deviations occur. ', 0, '0', 0, 'Weekly', 20, 2, 3, '2019-07-25', '2019-07-05 11:17:00', NULL, '00:00:00', '2019-11-01 11:17:00', '00:00:00', 1, 1, 41, 97, 0),
